Chaka Khan [born Yvette Marie Stevens; March 23, 1953] is an American-British singer and 
composer who gained fame in the 1970s as the frontwoman and focal point of the funk band Rufus. 
While still a member of the group in 1978, Khan embarked on a successful solo career. 
Her signature hits, both with Rufus and as a solo performer, include &quot;Tell Me Something Good&quot;, 
&quot;Sweet Thing&quot;, &quot;Ain't Nobody&quot;, &quot;I'm Every Woman&quot;, &quot;I Feel for You&quot; and &quot;Through the Fire&quot;




